# Alexandrovka, Kamyshlinsky Selsoviet, Karmaskalinsky District, Republic of Bashkortostan

}}
Alexandrovka () is a rural locality (a selo) in Kamyshlinsky Selsoviet, Karmaskalinsky District, Bashkortostan, Russia. The population was 188 as of 2010.
Geography
It is located 27&nbsp;km from Karmaskaly and 5&nbsp;km from Kamyshlinka.
